import React from "react";

function App() {
  return (
    <React.Fragment>
      <span style={{ fontFamily: "Unna", fontStyle: "italic", fontSize: 100 }}>
        Vivan &nbsp;
      </span>
      <span
        style={{
          fontFamily: "Unna",
          fontStyle: "Bold 700",
          fontSize: 100,
        }}
      >
        Marwaha
      </span>
    </React.Fragment>
  );
}

export default App;
